import svgimg from './react.png';

function MainPage() {
    return (
        <div>
        <nav>
            <img src={svgimg} alt="react" width="40px" />
            <h1>Fun Facts About React</h1>
            <ul>
                <li>Fact-1</li>
                <li>Fact-2</li>
                <li>Fact-3</li>
                <li>Fact-4</li>
            </ul>
        </nav>
    </div>
    )
}

